// Home.js

import React, { useState } from 'react';
import OptimalPlan from './pages/OptimalPlan';
import LearningAssist from './pages/LearningAssist';
import './Home.css';

function Home() {
  const [activeTab, setActiveTab] = useState('Optimal Plan');

  const renderTabContent = () => {
    switch (activeTab) {
      case 'Optimal Plan':
        return <OptimalPlan />;
      case 'Learning Assistant':
        return <LearningAssist />;
      default:
        return null;
    }
  };

  return (
    <div className="home-container">
      <header className="home-header">
        <h1>Study Tracker</h1>
        <button onClick={() => setActiveTab('Learning Assistant')} className="learning-assistant-btn">
          Learning Assistant
        </button>
      </header>

      <div className="tab-content">
        {renderTabContent()}
      </div>
    </div>
  );
}

export default Home;
